import './App.css';
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import { BrowserRouter, Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div>
        <BrowserRouter>
        <Routes>
        <Header/>
          <Route path="AddTimeTable" element={<AddTimeTable/>}/>



        </Routes>
        </BrowserRouter>
        </div>



  );
}

export default App;
